import React from 'react';
import axios from 'axios';
import { Link as RouterLink } from 'react-router-dom';
import { AppBar, BottomNavigation, BottomNavigationAction } from '@material-ui/core';
import ArchiveIcon from '@material-ui/icons/Archive';
import WarningIcon from '@material-ui/icons/Warning';
import DeleteIcon from '@material-ui/icons/Delete';
import MarkunreadIcon from '@material-ui/icons/Markunread';
import SnoozeIcon from '@material-ui/icons/Snooze';
import MoveToInboxIcon from '@material-ui/icons/MoveToInbox';
import LabelIcon from '@material-ui/icons/Label';
import MoreVertIcon from '@material-ui/icons/MoreVert';
import ArrowBackIcon from '@material-ui/icons/ArrowBack';

import HomeIcon from '@material-ui/icons/Home';

class NavBar extends React.Component {
    constructor(props) {
        super(props)
        const dt = new Date()
        this.state = {
            start: dt,
            lastClickTime: dt
        }
    }

    logClick = (e) => {
        const dt = new Date()
        axios({
            method: 'post',
            url: 'http://localhost:8080/logging',
            data: {
                id: e.currentTarget.id,
                time: (dt - this.state.start) / 1000
            }
        })

    }

    render() {
        return (
            <AppBar position="fixed" style={{top: 'auto', bottom: 0}}>
                <BottomNavigation>
                    <BottomNavigationAction label="Archive" id="archive" icon={ <ArchiveIcon/>} component={RouterLink} to="/page" onClick={this.logClick} />
                    <BottomNavigationAction label="Home" id="warning" icon={<HomeIcon/>} color="inherit" onClick={this.logClick} />
                    <BottomNavigationAction label="Delete" id="delete" icon={<DeleteIcon/>} color="inherit" onClick={this.logClick} />
                    <BottomNavigationAction label="Unread" id="unread" icon={<MarkunreadIcon/>} color="inherit" onClick={this.logClick} />
                    <BottomNavigationAction label="Snooze" id="snooze" icon={<SnoozeIcon/>} color="inherit" onClick={this.logClick} />
                    <BottomNavigationAction label="Move" id="move" icon={<MoveToInboxIcon />} color="inherit" onClick={this.logClick} />
                    <BottomNavigationAction label="Label" id="label" icon={<LabelIcon />} color="inherit" onClick={this.logClick} />
                    <BottomNavigationAction label="More" id="more" icon={<MoreVertIcon/>} color="inherit" onClick={this.logClick} />
                    <BottomNavigationAction label="Back" id="home" icon={<ArrowBackIcon/>} color="inherit" component={RouterLink} to="/" onClick={this.logClick} />
                </BottomNavigation>
            </AppBar>
        );
    }
}

export default NavBar;
